import React from 'react';
import { Container } from './styled/Container.styled';
import { Huddlefootericon, Huddleleftpage, Huddlelogo, Huddlemockups, Huddlerightpage, Registerbutton, Styledhuddlelandingpage } from './styled/Landingpage.styled';
import fbicon from './images/facebook-f.svg';
import twiticon from './images/twitter.svg';
import igicon from './images/instagram.svg';
import logo from './images/logo.svg';
import mockups from './images/illustration-mockups.svg';

export const Huddlelandingpage = () => {
  return (
    <Container>
        <Styledhuddlelandingpage>
          <Huddleleftpage>
            <Huddlelogo src={logo} alt='logo'/>
            <Huddlemockups src={mockups} alt='mockups'/>
          </Huddleleftpage>
          <Huddlerightpage>
            <h1>
              Build The Community Your Fans Will Love
            </h1>
            <p>
              Huddle re-imagines the way we build communities. You have a voice, but so does your audience. 
              Create connections with your users as you engage in genuine discussion.
            </p>
          <Registerbutton>
            Register
          </Registerbutton>
          <Huddlefootericon>
            <img src={fbicon} alt='fbicon' width={15}/>
            <img src={twiticon} alt='twiticon' width={25}/>
            <img src={igicon} alt='igicon' width={25}/>
          </Huddlefootericon>
          </Huddlerightpage>
        </Styledhuddlelandingpage>
    </Container>
  )
}
